import React from 'react';

import BizHeader from './BizHeader';
import NavBar from './Navbar';
import PageContent from './PageContent';
import Footer from './Footer';
import { Box } from '@material-ui/core';

function App() {
  return (
    <Box display="inline-flex">
      <NavBar />
      <BizHeader />
      <PageContent />
      <Footer />
    </Box>
  );
}

export default App;
